(1, 1, 'Acoustic Guitars','Acoustic Guitars', 389900, 'The J-45 is Gibson"s best-selling acoustic of all time. Nicknamed "The Workhorse" and first introduced in 1942, this iconic acoustic has become the cornerstone of its round-shoulder, dreadnought line. World renowned for its full, balanced expression, warm bass and excellent projection, the J-45 has been refined to carry this legacy to new heights. This 2019 model delivers a sound with incredible dynamic range, warm mids, and a tight punchy bass.', 'https://cdn.long-mcquade.com/files/122144/lg_0849cf1739933778466c260a39932bde.webp?alt=J-45%20Standard%20Vintage%20Sunburst'),
